import HelloWorld from '@/components/HelloWorld.vue';
import Chart from '@/components/Chart.vue';
import SidebarItem from '@/components/SidebarItem.vue';

export default {
  name: 'App',
  components: {
    Chart,
    SidebarItem,
  },
  data() {
    return {
      drawer: null,
      active: 0,
      criteria: '',
    };
  },
  props: {
    source: String,
  },
  methods: {
    range(){
      return [...Array(this.$store.state.names.length).keys()];
    },
    setActive(index: number){
      this.active = index;
    },
    getName(index: number){
      return this.$store.state.names[index];
    },
    filteredRange(){
      let OG = this.range();
      return OG.map(idx => [idx, this.$store.state.names[idx]]).filter(tuple => approved(tuple[1])).map(tuple => tuple[0])
    },
    approved(name: string):boolean{
      return name.contains(this.criteria.toLowerCase());
    }
  }
};
